INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24001, 2, 401, "2020/07/31 12:00:00", 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, "アヤネ", 2, 102301, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24002, 1, 402, "2020/07/31 12:00:00", 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, "アヤネ", 2, 102301, 2.21, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24003, 2, 403, "2020/07/31 12:00:00", 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, "アヤネ", 2, 102301, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24004, 2, 701, "2020/07/31 12:00:00", 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, "アサヒ", 1, 192201, 1.99, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24005, 1, 702, "2020/07/31 12:00:00", 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, "アサヒ", 2, 192201, 2.21, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24006, 2, 703, "2020/07/31 12:00:00", 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, "アサヒ", 1, 192201, 3.33, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24007, 2, 801, "2020/07/31 12:00:00", 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, "部員３", 2, 192301, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24008, 1, 802, "2020/07/31 12:00:00", 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, "部員３", 2, 192301, 2.68, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24009, 2, 803, "2020/07/31 12:00:00", 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, "部員３", 2, 192301, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24010, 1, 501, "2020/07/31 12:00:00", 24, "やった！", 10046, "", 1, 192501, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24011, 1, 502, "2020/07/31 12:00:00", 24, "勝ったよ！", 10046, "", 1, 192501, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24012, 1, 503, "2020/07/31 12:00:00", 24, "いい調子！", 10046, "", 1, 192501, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24013, 6, 111, "2020/07/31 12:00:00", 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, "ミサト", 2, 113501, 5.33, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24014, 1, 112, "2020/07/31 12:00:00", 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, "ミサト", 2, 113501, 6.85, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24015, 1, 113, "2020/07/31 12:00:00", 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, "ミサト", 2, 113501, 3.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24016, 1, 611, "2020/07/31 12:00:00", 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, "ダイチ", 2, 192401, 6.11, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24017, 1, 612, "2020/07/31 12:00:00", 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, "ダイチ", 2, 192401, 6.75, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24018, 2, 613, "2020/07/31 12:00:00", 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, "ダイチ", 2, 192401, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24019, 2, 211, "2020/07/31 12:00:00", 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, "ハツネ", 1, 113401, 4.52, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24020, 2, 212, "2020/07/31 12:00:00", 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, "ハツネ", 1, 113401, 3.89, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24021, 1, 213, "2020/07/31 12:00:00", 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, "ハツネ", 2, 113401, 13.49, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24022, 1, 311, "2020/07/31 12:00:00", 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, "カヤ", 2, 106501, 3.17, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24023, 1, 312, "2020/07/31 12:00:00", 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, "カヤ", 2, 106501, 4.42, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24024, 6, 313, "2020/07/31 12:00:00", 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, "カヤ", 1, 106501, 2.89, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24025, 4, 421, "2020/07/31 12:00:00", 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, "アヤネ", 3, 102301, 3.71, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24026, 2, 721, "2020/07/31 12:00:00", 24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, "アサヒ", 1, 192201, 5.1, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24027, 1, 821, "2020/07/31 12:00:00", 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, "部員３", 3, 192301, 4.34, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24028, 1, 521, "2020/07/31 12:00:00", 24, "いい勝負だったよ\nまたやろうね", 10046, "", 1, 192501, 0.0, 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24029, 1, 101, "2020/07/31 12:00:00", 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, "ミサト", 2, 113501, 5.62, -360.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24030, 1, 102, "2020/07/31 12:00:00", 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, "ミサト", 2, 113501, 9.58, -360.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24031, 2, 103, "2020/07/31 12:00:00", 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, "ミサト", 2, 113501, 0.0, -360.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24032, 2, 104, "2020/07/31 12:00:00", 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, "ミサト", 1, 113501, 9.13, -360.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24033, 1, 105, "2020/07/31 12:00:00", 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, "ミサト", 2, 113501, 8.27, -360.0, 0.0, "2030/12/17 14:59:59");
